const H1 = styled.h1`
  font-size: 80px;
  background: -webkit-linear-gradient(#AE1D1D, #ff0000);
  text-shadow: #fff 5px 0 20px;
`

export default function Logo () {
return <H1>{'Amigo Secreto'}</H1>

}
